      headerIcon: <IoIosCheckmarkCircle />,
      name: "Automative Trading System",
      description: "computer manage our fund",
      priceWithUnit: "SALE",
      buttonText: "Buy NFT",
      anotherOption: "",
      points: [
        {
          id: 1,
          icon: <IoIosCheckmarkCircle />,
          text: "Automatically trading assets",
          isAvailable: true,
