        },
        {
          id: 4,
          icon: <IoIosCheckmarkCircle />,
          text: "risk management",
          isAvailable: true,
        },
      ],
    },
  ],
  annual: [
    {
      id: 1,
      name: "NFT Listing",
      description: "you can listing your NFT on the marketplace",
      buttonText: "SELL NFT ",
      priceWithUnit: "SALE",
      points: [
        {
          id: 1,
          icon: <IoIosCheckmarkCircle />,
          text: "easy to listing",
          isAvailable: true,
        },
        {
          id: 2,
          icon: <IoIosCheckmarkCircle />,
          text: "fast bid list",
          isAvailable: true,
        },
        {
          id: 3,
          icon: <IoIosCheckmarkCircle />,
          text: "on the website",
          isAvailable: true,
